INSERT INTO `tickets` VALUES (17,'Bug','anderkrox',48,'andersonsacani93@gmail.com','Closed','\"Resumo: Encontrei um bug nas cavernas de Dwarfs perto da entrada de kazordoon, perto do tapete de carlin, onde ao tentar usar corda em um spot de corda, nada acontece, as fotos da entrada da caverna e do spot de corda bugado estão inclusos no report.\\r\\n\\r\\n\\r\\nReproduzindo: para reproduzir o bug, use sua corda no spot de corda marcado na foto que segue com o report.\"',1681245562,NULL,'pt-br',1681246270,'Marcus'),(18,'Bug','garry',53,'garryboinaverde@gmail.com','Closed','\"Summary:  teste\\r\\n\\r\\nReproducing the bug: teste\"',1681316808,NULL,'eng',1681316947,'Marcus'),(19,'Bug','garry',53,'garryboinaverde@gmail.com','Pending Staff Response','\"Resumo:  teste port\\r\\n\\r\\nReproduzindo o bug: teste port\"',1681316872,NULL,'eng',NULL,NULL),(20,'Payment','garry',53,'garryboinaverde@gmail.com','Pending Staff Response','\"Summary: \\r\\n\\r\\nTransaction type: \\r\\n\\r\\nEvidences: \\r\\n\\r\\nPayer Full Name: \\r\\n\\r\\nFirst 3 and last 3 digits of payer id: \\r\\n\\r\\nTransaction Time:\"',1681344062,NULL,'eng',NULL,NULL),(21,'Payment','garry',53,'garryboinaverde@gmail.com','Pending Staff Response','\"Resumo: \\r\\n\\r\\nTipo de transação: \\r\\n\\r\\nEvidencias: \\r\\n\\r\\nNome completo do pagador: \\r\\n\\r\\nPrimeiros 3 e últimos 3 dígitos do cpf do pagador: \\r\\n\\r\\nHorário da transação:\"',1681344087,NULL,'eng',NULL,NULL),(22,'Bug','garry',53,'garryboinaverde@gmail.com','Pending Staff Response','\"Summary: aaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaa\\r\\n\\r\\nReproducing the bug:aaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaa\"',1681651413,NULL,'eng',NULL,NULL);
